    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.14CLICKSAVEANDCLOSE.DESCRIPTION" : "Щелкните здесь, чтобы сохранить настройки и вернуться к редактору рабочих процессов.",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.14CLICKSAVEANDCLOSE.TITLE" : "Нажмите кнопку «Сохранить и закрыть».",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.15CHOOSETHETRANSITIONTOEDIT" : "Выберите переход для редактирования",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.15CHOOSETHETRANSITIONTOEDIT.DESCRIPTION" : "Вы также можете изменить поведение при переходе в следующий шаг. Щелкните значок небольшого круга на переходе и щелкните имя перехода, чтобы открыть его настройки.",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.15CHOOSETHETRANSITIONTOEDIT.TITLE" : "Выберите переход для редактирования",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.16TRANSITIONSETTINGS" : "Настройки перехода",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.16TRANSITIONSETTINGS.DESCRIPTION" : "Настройки перехода похожи на настройки шага. Настройка, которой нет в настройках шага — \"[b]Разрешения[/b]\", где вы выбираете пользователей, которым разрешается выполнять переход, например разрешить руководителям команд выполнять одобрение документов.<br>\r\n\r\nДополнительную информацию о настройках вы найдете в нашей базе знаний. Нажмите кнопку \"Сохранить\", когда все будет готово.",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.16TRANSITIONSETTINGS.TITLE" : "Настройки перехода",
