    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.17CLICKSAVEANDCLOSE.DESCRIPTION" : "Щелкните здесь, чтобы сохранить настройки и вернуться к редактору рабочих процессов.",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.17CLICKSAVEANDCLOSE.TITLE" : "Нажмите кнопку «Сохранить и закрыть».",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.18FINISHEDITINGTHEWORKFLOW" : "Закончите редактирование процесса",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.18FINISHEDITINGTHEWORKFLOW.DESCRIPTION" : "Настройте самостоятельно параметры оставшихся шагов и переходов в процессе. Нажмите кнопку \"Сохранить и закрыть\", когда все будет готово.",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.18FINISHEDITINGTHEWORKFLOW.TITLE" : "Закончите редактирование процесса",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.19ADDANDEDITDATAFIELDS" : "Добавьте и настройте поля данных",
    "HELPER.TUTORIALS.TUTORIALHOWTOCREATEWORKFLOWFROMSCRATCH.19ADDANDEDITDATAFIELDS.DESCRIPTION" : "В каждой процессной задаче есть форма данных, которая заполняется при прохождении задачи по процессу. Используйте эту форму для занесения в нее данных по мере продвижения задачи по процессу.<br>\n\nНажмите кнопку \"Поля\", чтобы добавить поля данных.",
